$(document).ready(function(){$("[data-page]").click(function(){let n=isNaN(parseInt($(this).attr("data-page")))?-1:parseInt($(this).attr("data-page")),t=$("#search").val().trim();n=n-1;var i=$(this);i.prop("disabled",!0);$.get("/Home/PageUrl/",{page:n,limit:30,text:t}).done(()=>{$("#view-search").html()})});$("#search-api").click(function(){let t=$("#search").val().trim();if(t.length<2)return!1;var n=$(this);n.prop("disabled",!0);n.find("span").fadeIn();$.get("/Home/Search/",{text:t}).always(()=>{n.prop("disabled",!1),n.find("span").fadeOut()}).done(()=>{$("#view-search").html()})});$("#search-in").click(function(){let t=$("#search").val().trim();if(t.length<2)return!1;var n=$(this);n.prop("disabled",!0);n.find("span").fadeIn();$.get("/Home/PageUrl/",{text:t}).always(()=>{n.prop("disabled",!1),n.find("span").fadeOut()}).done(()=>{$("#view-search").html()})})});